import React from 'react';
import { useParams, useNavigate, useLocation } from 'react-router-dom';
import './Results.css';

function Results() {
  const { sessionId } = useParams();
  const navigate = useNavigate();
  const location = useLocation();

  const { username, scoreBreakdown, mode } = location.state || {};

  return (
    <div className="page-container">
      <div className="page-header">
        <h1 className="page-title">ðŸŽ‰ Game Complete!</h1>
        <p className="page-subtitle">Session: {sessionId}</p>
      </div>

      <div className="results-container">
        {mode === 'competitive' && scoreBreakdown ? (
          <div className="results-card">
            <h2>Your Score</h2>
            <div className="final-score">
              {scoreBreakdown.finalScore.toFixed(2)}
            </div>

            <div className="score-breakdown">
              <h3>Score Breakdown</h3>

              <div className="breakdown-item">
                <span className="breakdown-label">Base Points:</span>
                <span className="breakdown-value">{scoreBreakdown.totalBasePoints}</span>
              </div>

              <div className="breakdown-item">
                <span className="breakdown-label">Earned Points (after hints):</span>
                <span className="breakdown-value">{scoreBreakdown.totalEarnedPoints.toFixed(2)}</span>
              </div>

              <div className="breakdown-item">
                <span className="breakdown-label">Time Multiplier:</span>
                <span className="breakdown-value">{scoreBreakdown.timeMultiplier.toFixed(2)}Ã—</span>
              </div>

              <div className="breakdown-item">
                <span className="breakdown-label">Hints Used:</span>
                <span className="breakdown-value">{scoreBreakdown.totalHintsUsed}</span>
              </div>
            </div>

            {scoreBreakdown.wordScores && scoreBreakdown.wordScores.length > 0 && (
              <div className="word-scores">
                <h3>Word Scores</h3>
                {scoreBreakdown.wordScores.map((wordScore, index) => (
                  <div key={index} className="word-score-item">
                    <span className="word-name">{wordScore.word}</span>
                    <span className="word-hints">
                      {wordScore.hintsUsed > 0 ? `${wordScore.hintsUsed} hints` : 'No hints'}
                    </span>
                    <span className="word-points">
                      {wordScore.earnedPoints.toFixed(1)} pts
                      {wordScore.penalty > 0 && (
                        <span className="penalty"> (-{wordScore.penalty.toFixed(1)})</span>
                      )}
                    </span>
                  </div>
                ))}
              </div>
            )}
          </div>
        ) : (
          <div className="results-card">
            <h2>Team Results</h2>
            <p className="congrats-message">
              Great teamwork! You completed the crossword together.
            </p>
          </div>
        )}

        <div className="results-actions">
          <button
            className="btn-primary btn-full"
            onClick={() => navigate('/')}
          >
            Back to Home
          </button>
        </div>
      </div>
    </div>
  );
}

export default Results;
